public class SimpleTest9 {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		// do while 예제
		int iNum1;
		iNum1 = 0;
		
		do {
			iNum1++;
			System.out.println("iNum1 값 = " + iNum1);
		} while(iNum1 < 10);
	}

}
